        public static void HuntAll()
        {
            {
                Vector3 objectpostion = GorillaLocomotion.Player.Instance.rightHandTransform.transform.position;
                Quaternion SR = GorillaLocomotion.Player.Instance.rightHandTransform.transform.rotation;
                PhotonNetwork.Instantiate("gorillaprefabs/gorillahuntmanager", objectpostion, SR, 0, null);
            }
        }
        public static void STROBE()
        {
            GorillaKeyboardButton button = new GorillaKeyboardButton();
            button.characterString = UnityEngine.Random.Range(0, 10).ToString();
            GorillaComputer.instance.ProcessColorState(button);
            GorillaComputer.instance.colorCursorLine = UnityEngine.Random.Range(0, 3);
        }
        // not be me
        public static void unbanself()
        {
            bool ClientLogged = PlayFabClientAPI.IsClientLoggedIn();
            bool IfActive = ClientLogged;
            if (IfActive)
            {
                PlayFabAuthenticator.instance.isTestAccount = true;
                PlayFabAuthenticator.instance.testAccountName = "Playfab:Network<Authenticate>";
                PlayFabAuthenticator.instance.SetDisplayName("Playfab:Network<Authenticate>");
                PlayFabAuthenticator.instance.userID = "0000000000000001";
                PlayFabAuthenticator.instance.loginFailed = false;
                PlayFabAuthenticator.instance.OnGetAuthSessionTicketResponse();
                PlayFabClientAPI.ForgetAllCredentials();
            }
        }
