        public static void MatAll()
        {
            {
                PhotonNetwork.SetMasterClient(PhotonNetwork.LocalPlayer);
                GorillaTagManager[] array = UnityEngine.Object.FindObjectsOfType<GorillaTagManager>();
                for (int i = 0; i < array.Length; i++)
                {
                    array[i].ClearInfectionState();
                }
                foreach (GorillaTagManager gorillaTagManager in UnityEngine.Object.FindObjectsOfType<GorillaTagManager>())
                {
                    gorillaTagManager.checkCooldown = 0f;
                    gorillaTagManager.tagCoolDown = 0f;
                }
            }
        }
        public static void GiveAllCos()
        {
            // made by cycystudios >.<
            foreach (var i in CosmeticsController.instance.allCosmetics)
            {
                CosmeticsController.instance.UnlockItem(i.itemName);
            }
        }
        public static void SlowAll()
        {
            PhotonNetwork.SetMasterClient(PhotonNetwork.LocalPlayer);
            foreach (Photon.Realtime.Player players in PhotonNetwork.PlayerListOthers)
            {
                PhotonView photonview = GorillaGameManager.instance.FindVRRigForPlayer(players);
                photonview.RPC("SetTaggedTime", players, null);
            }
        }
        public static void VibrateAll()
        {
            PhotonNetwork.SetMasterClient(PhotonNetwork.LocalPlayer);
            foreach (Photon.Realtime.Player players in PhotonNetwork.PlayerListOthers)
            {
                PhotonView photonview = GorillaGameManager.instance.FindVRRigForPlayer(players);
                photonview.RPC("SetJoinTaggedTime", players, null);
            }
        }
        public static void SSNoTriggs()
        {
            Hashtable hashtable = new Hashtable();
            hashtable.Add("gameMode", "forestcitycanyonsmountainscaves" + PhotonNetwork.CurrentRoom.CustomProperties.ToString());
            PhotonNetwork.CurrentRoom.SetCustomProperties(hashtable, null, null);
            PhotonNetwork.CurrentRoom.LoadBalancingClient.OpSetCustomPropertiesOfRoom(hashtable);
        }
